        <div>
          <textarea></textarea>
        </div>
        <button>add post</button>
      </div>
      <div>
        <Post message="Hi, how are you" like="15" />
        <Post message="it's my first post" like="20" />
      </div>
    </div>
  );
}

export default MyPosts;
